import React from 'react';
import { Link } from 'react-router-dom';
import './navbar.css';
function Navbar() {
  return (
    <div>
      <ul>
        <Link to="/login">Login</Link>
        <Link to="/register">Register</Link>
        <Link to="/posts">Posts</Link>
      </ul>
    </div>
  );
}

export default Navbar;
